どこでもベープNo.1 未来 取替え用 2個入<br>ブランド：どこでもベープ<br>販売・製造元：フマキラー<br><br>腕や足に巻いたり、腰に吊るしたり屋外で使える虫除けの取替え用です。<br>1個につき1日6時間使用で20日間(120時間)使用できます。<br>従来器具(どこでもベープNo.1シリーズ)にも使えます(この場合の効力は3倍です)。<br>※ 本体は別売りです <br><br>超・携帯「どこでもベープNo.1」シリーズ器具の取替え<br>電池式の定番、選ばれてNo.1。<br>「どこでもベープNo.1 未来」「どこでもベープNo.1セット」のどちらの器具にも使える薬剤です。<br><br>●薬剤はワンタッチで着脱可能。<br>●ランプが点灯しなくなったら、お取替え。<br>※単4アルカリ電池が別途必要となります。<br>●どこでもベープNo.1未来、どこでもベープNo.1セットのどちらにも使用できます。<br><br>お問い合わせ先<br>フマキラー株式会社<br>お客様相談室：0077-788-555/03-3255-6400 <br><br>JANコード： 4902424431872<br><br>CS：40<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
